DROP TABLE IF EXISTS `etudiant`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `etudiant` (
  `idEtudiant` varchar(100) NOT NULL,
  `cin` varchar(45) DEFAULT NULL,
  `prenom` varchar(45) DEFAULT NULL,
  `nom` varchar(45) DEFAULT NULL,
  `sexe` varchar(45) DEFAULT NULL,
  `dateNaissance` varchar(45) DEFAULT NULL,
  `idNationalite` int(11) DEFAULT NULL,
  `lieuNaissance` varchar(45) DEFAULT NULL,
  `email` varchar(45) DEFAULT NULL,
  `telephone` varchar(45) DEFAULT NULL,
  `imagePath` varchar(350) NOT NULL,
  `cne` varchar(45) DEFAULT NULL,
  `dateInscription` varchar(45) DEFAULT NULL,
  `provenance` varchar(45) DEFAULT NULL,
  `idFiliere` int(11) DEFAULT NULL,
  `idNiveau` int(11) DEFAULT NULL,
  `idScolarite` int(11) DEFAULT NULL,
  `idParentInfo` int(11) DEFAULT NULL,
  `idGroupe` int(11) DEFAULT NULL,
  PRIMARY KEY (`idEtudiant`),
  KEY `fk_nationalite` (`idNationalite`),
  KEY `fk_filiere` (`idFiliere`),
  KEY `fk_niveau` (`idNiveau`),
  KEY `fk_scolarite` (`idScolarite`),
  KEY `fk_parentinfo` (`idParentInfo`),
  KEY `fk_grp` (`idGroupe`),
  CONSTRAINT `idFiliere` FOREIGN KEY (`idFiliere`) REFERENCES `filiere` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `idGroupe` FOREIGN KEY (`idGroupe`) REFERENCES `groupe` (`idGroupe`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `idNationalite` FOREIGN KEY (`idNationalite`) REFERENCES `nationalite` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `idNiveau` FOREIGN KEY (`idNiveau`) REFERENCES `niveau` (`idNiveau`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `idParentInfo` FOREIGN KEY (`idParentInfo`) REFERENCES `parentinfo` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `idScolarite` FOREIGN KEY (`idScolarite`) REFERENCES `scolarite` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

